import React,{useState} from "react";
import ReactDOM from "react-dom";

function App(){
const [count,setCount] = useState(11)

function changeCount(){
    setCount(12);
}

ReactDOM.render(
        <div>
            <h1>{count}</h1>
            <button onClick={changeCount}>+</button>
        </div>,
);

}

ReactDOM.render(<App/>,document.getElementById("root"));
